INSERT INTO `proyecto` (`codigo`,`num_resolucion`,`titulo`,`descripcion`,`tipo`,`estado`,`fecha_inicio`,`fecha_fin`,`detalle`) VALUES ("6581630159920464666","5890099680923806656","Desarrollo de app Web GISFPP","El proyecto consiste en el desarrollo de una aplicación web para la gestión interna de instancias supervisadas de formación práctica profesional correspondientes a la Facultad de Ingenieria sede Puerto Madryn de la UNPSJB","INTERNO","ACTIVO","2015-09-01","2016-03-30","Parte del desarrollo de esta aplicacion corresponde al Proyecto Final de Carrera del alumno Devia José Luis de la carrera Analista Programador Universitario");
INSERT INTO `proyecto` (`codigo`,`num_resolucion`,`titulo`,`descripcion`,`tipo`,`estado`,`fecha_inicio`,`fecha_fin`,`detalle`) VALUES ("AR-M1001","ATN/ME-8762","Aplicación de TICs para PyMES Sector Metalurgico","El objetivo general del Proyecto es contribuir al mejoramiento de la productividad de las PyMEs del sector metalúrgico de Argentina mediante la aplicación de herramientas de las TICs. El objetivo específico es establecer un proceso continuo de intervención tecnológica para incorporar el uso de las TICs en las PyMEs del sector metalúrgico. ","EMPRESA","FINALIZADO","2016-10-08","2015-09-07","Los beneficiarios del Proyecto serán: i) las PyMEs metalúrgicas argentinas que tendrán fácil acceso a la información adecuada y a los servicios de las TICs para el mejoramiento continuo de su eficiencia y producción; ii) las cámaras regionales metalúrgicas que desarrollen la capacidad para articular la demanda y oferta tecnológica; y iii) el sector metalúrgico argentino que contará con la experiencia colectiva de haber establecido un proceso continuo de intervención tecnológica de las TICs para las PyMEs. ");
INSERT INTO `proyecto` (`codigo`,`num_resolucion`,`titulo`,`descripcion`,`tipo`,`estado`,`fecha_inicio`,`fecha_fin`,`detalle`) VALUES ("AR-M1004","ATN/ME-9355-AR","Competitividad Empresas Autogestionadas y Sistematizacion de Modelos de Gestion","El objetivo específico es apoyar la aplicación de modelos de gestión empresarial sostenibles. Para ello, el Programa identificará, apoyará y sistematizará diferentes experiencias de gestión de pequeñas empresas autogestionadas, a través del mejoramiento en la gestión de las PEA, y del análisis comparado de la autogestión y difusión de lecciones aprendidas.","INVESTIGACION","GENERADO","2016-10-21","2016-06-04","Mejoramiento de la gestión de pequeñas empresas autogestionadas.: Mejorar la gestión de las PEA o grupos de PEA, mediante la co-financiación de asistencia técnica y capacitación, en temas jurídicos,organizativos, productivos, administrativos, financieros y comerciales, mejorando sus condiciones como sujetos elegibles para el crédito y de esta forma, facilitando el acceso al financiamiento orientado al incremento del capital de trabajo, reparación y adquisición de equipamiento y re-acondicionamiento de infraestructura e instalaciones.");
INSERT INTO `proyecto` (`codigo`,`num_resolucion`,`titulo`,`descripcion`,`tipo`,`estado`,`fecha_inicio`,`fecha_fin`,`detalle`) VALUES ("AR-M1005","ATN/ME-9415-AR","Apoyo Consolidación Sistema Microfinanciero con Fondo Capital Social","Consolidar técnica e institucionalmente a FONCAP como una entidad líder de segundo piso, y la plataforma de servicios técnicos que actualmente FONCAP ofrece a las IMFs","EMPRESA","FINALIZADO","2016-10-31","2016-10-22","Este componente es el más importante para el éxito del Programa, ya que sin IMFs fortalecidas que puedan usar sus recursos financieros eficientemente, no habría razón para apoyar a FONCAP como institución de segundo piso. El componente permitiría financiar el fortalecimiento de las áreas críticas para las IMFs. El incentivo que estas IMFs tendrán para aceptar la capacitación es que FONCAP tendrá como principio general el requerimiento que una IMF que aplique a crédito debería tomar también el servicio de asistencia técnica para la evaluación institucional, que elaborará un diágnostico que resultará en una agenda de desarrollo institucional modelado especificamente para la IMF, que ésta tendrá que resolver. Se diseñará un nuevo sistema de evaluación institucional, que sustituya al actual, y que posibilite: (a) establecer a partir de la estandarización, criterios de evaluación de IMFs considerando la posterior implementación de la Calificadora de IMFs en el Programa; (b) promover procesos de normalización y estandarización de criterios de evaluación institucional al interior de FONCAP; y (c) transferir al equipo de Analistas de FONCAP las metodologías desarrolladas, para ser aplicadas en todas las instituciones clientes. Una vez completado el nuevo sistema, se realizará el diagnóstico institucional que permita determinar las debilidades de las IMFs a ser asistidas técnicamente. A través de este componente se transferirán recursos técnicos y metodológicos a cada IMFs participante del Programa. Se comenzará con seis IMFs, hasta alcanzar a 34 IMFs al final del Programa. La consultora que se contrate para capacitar a los técnicos de FONCAP deberá adicionalmente proveer de estándares de la industria a nivel internacional, preferentemente de la región, para el análisis comparado y el benchmarking entre IMFs. Este conjunto de indicadores de volumen y crecimiento de cartera, niveles de morosidad y evolución patrimonial, así como diversificación de producto y tecnologías crediticias, servirán como referencia para las instituciones de la red FONCAP, y será aplicable también al sistema de calificación de IMFs previsto por el Programa. Las IMFs cubrirán un porcentaje de hasta el 30%, de los costos respectivos de la asistencia técnica que reciban. FONCAP determinará en algunos casos, un porcentaje menor, de acuerdo al nivel de desarrollo institucional de las IMFs. También se revisará el actual programa de capacitación de FONCAP, que estará destinado tanto a las organizaciones de la red como a otras no clientes de FONCAP. FONCAP desarrollará un aula virtual que estará basada en su portal web. Los servicios de capacitación para IMFs, contemplarán un sistema de cofinanciación entre FONCAP y dichas instituciones, a través de un subsidio decreciente orientado hacia la sustentabilidad de estas actividades, y que comenzaría con un 70% a cargo de FONCAP durante el primer año, 50% el segundo año, 25% el tercero, y 0% al término del Programa con financiamiento FOMIN.  FONCAP ha venido implementando un programa de capacitación basado en esquemas de co-financiación entre FONCAP y las IMFs para la provisión de servicios, lo que asegura que podrá también implementar este esquema dentro del Programa. Para perfeccionar el proceso de seguimiento de las actividades de las IMFS, se las  vinculará mediante la creación de un tablero de comando matricial, orientado a la implementación de un Management Information System (MIS). FONCAP desarrollará la plataforma informática de captura de información de seguimiento, así como la instalación en las IMFs de los recursos informáticos y organizacionales para su integración al sistema.  FONCAP también desarrollará la metodología para la actualización de líneas de base de grupo meta de IMFs, necesarias para seguimiento y evaluación de impacto.");
INSERT INTO `proyecto` (`codigo`,`num_resolucion`,`titulo`,`descripcion`,`tipo`,`estado`,`fecha_inicio`,`fecha_fin`,`detalle`) VALUES ("AR-M1012","ATN/ME-9861-AR","Competitividad de Clusters en la Region Central de la Provincia de Santa Fe","Aumentar la competitividad y la inserción internacional de los clústers agroindustrial y metalmecánico de la Región Central de la Provincia de Santa Fe.","INVESTIGACION","FINALIZADO","2016-02-14","2016-09-04","Desarrollo de capacidades tecnológicas e innovación productiva. En este ámbito, se prevé apoyar dos iniciativas específicas: (i) Diseño e implementación de un programa de mejoramiento genético del ganado lechero destinado a aumentar la competitividad de las empresas y la inserción de éstas en los mercados internacionales. El Programa financiará principalmente el diseño e implementación de un “Plan de extensión del Programa de Mejoramiento Genético para ganado Holando Argentino” y el desarrollo de una iniciativa asociativa para la exportación de esta genética; (ii) la adecuación tecnológica de maquinaria y equipos (Retrofitting) que persigue estructurar una masa crítica de habilidades en el reciclado de máquinas de producción y su mantenimiento e incorporar mejoras tecnológicas. El Programa financiará el estudio de las necesidades técnicas, la capacitación de los técnicos de las empresas y el diseño de un curso que pueda ser incorporado a la oferta local. ");
INSERT INTO `proyecto` (`codigo`,`num_resolucion`,`titulo`,`descripcion`,`tipo`,`estado`,`fecha_inicio`,`fecha_fin`,`detalle`) VALUES ("AR-M1009","ATN/ME-9531-AR","Gestión Ambiental para una Producción más Limpia en la Region Centro","Implementar prácticas de Producción más Limpia (PmL) en las PyMEs como una estrategia de competitividad.","EMPRESA","SUSPENDIDO","2016-03-29","2016-08-30","Fortalecimiento de la demanda.: Este componente tiene como propósito promover la PmL entre las PyME de la Región Centro de Argentina, en los sectores manufacturero, agroindustrial y de servicios, a través de la sensibilización y capacitación de empresarios acerca de las ventajas de la utilización de las herramientas de PmL.");
